const Login = () => {
    return (
        <div>
            <h1>Assalamualaikum</h1>
        </div>
    )
}

import React from 'react'
import styles from './c_iphone-14-3.module.css'
const CIphone143 = (props) => {
  return (
    <div className={styles['frame']}>
      <img
        src="./assets/7140.jpg"
        alt="rectangle"
        width={390}
        height={844}
        className={styles['rectangle']}
        />
      <img
        src="./assets/810.svg"
        alt="rectangle"
        width={390}
        height={521}
        className={styles['rectangle1']}
        />
      <div className={styles['text']}>
        <p className={styles['text1']}>Selamat Datang !</p>
      </div>
      <img
        src="./assets/815.svg"
        alt="line"
        width={110}
        height={1.0000152587890625}
        className={styles['line']}
        />
      <div className={styles['text2']}>
        <p className={styles['text3']}>Login</p>
      </div>
    </div>
  )
}

export default Login
